import React from 'react'
import { useSelector } from 'react-redux'

import { timeConverter } from '../../utils/timeConverter'


import styles from './TaskItem.module.css'

export const TaskItem = ({date, title}) => {

  const selectedStatus = useSelector(state => state.tasks.selectedStatus)

  return (
    <div className={styles.task}>

      <div className={styles.taskItemStatus}>Active</div>

      <h2 className={styles.taskTitle}>{title}</h2>

      <span>{timeConverter(date)}</span>

    </div>
  )
}
